const e=JSON.parse(`{"key":"v-35495555","path":"/se/framework/spring/ioc/Untitled.html","title":"","lang":"en-US","frontmatter":{"description":"循环依赖 Spring 通过三级缓存解决循环依赖问题，具体过程如下： 创建对象：当 Spring 容器创建一个对象时，会将该对象放入一级缓存中。 属性注入：当 Spring 容器对该对象进行属性注入时，如果发现该对象依赖于另一个对象，会先创建另一个对象并放入一级缓存中，然后将该对象放入二级缓存中。 循环依赖：如果发现另一个对象也依赖于该对象，会从二级缓存中获取该对象并注入到另一个对象中，然后将另一个对象放入二级缓存中。 初始化：当所有对象的属性都注入完成后，会按照依赖关系依次初始化对象，并将对象放入三级缓存中。 返回对象：当所有对象都初始化完成后，会从三级缓存中获取需要返回的对象，并将三级缓存清空。","head":[["meta",{"property":"og:url","content":"https://davidliuk.github.io/blog/blog/se/framework/spring/ioc/Untitled.html"}],["meta",{"property":"og:site_name","content":"David's Blog"}],["meta",{"property":"og:description","content":"循环依赖 Spring 通过三级缓存解决循环依赖问题，具体过程如下： 创建对象：当 Spring 容器创建一个对象时，会将该对象放入一级缓存中。 属性注入：当 Spring 容器对该对象进行属性注入时，如果发现该对象依赖于另一个对象，会先创建另一个对象并放入一级缓存中，然后将该对象放入二级缓存中。 循环依赖：如果发现另一个对象也依赖于该对象，会从二级缓存中获取该对象并注入到另一个对象中，然后将另一个对象放入二级缓存中。 初始化：当所有对象的属性都注入完成后，会按照依赖关系依次初始化对象，并将对象放入三级缓存中。 返回对象：当所有对象都初始化完成后，会从三级缓存中获取需要返回的对象，并将三级缓存清空。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2023-04-03T03:29:06.000Z"}],["meta",{"property":"og:locale","content":"en-US"}],["meta",{"property":"og:locale:alternate","content":"zh-CN"}],["meta",{"property":"article:modified_time","content":"2023-04-03T03:29:06.000Z"}],["link",{"rel":"alternate","hreflang":"zh-cn","href":"https://davidliuk.github.io/blog/blog/zh/se/framework/spring/ioc/Untitled.html"}]]},"headers":[{"level":2,"title":"循环依赖","slug":"循环依赖","link":"#循环依赖","children":[]}],"git":{"createdTime":1678024743000,"updatedTime":1680492546000,"contributors":[{"name":"davidliuk","email":"l729641074@163.com","commits":3}]},"readingTime":{"minutes":4.07,"words":1220},"localizedDate":"March 5, 2023","filePathRelative":"se/framework/spring/ioc/Untitled.md","excerpt":"<h2> 循环依赖</h2>\\n<p>Spring 通过三级缓存解决循环依赖问题，具体过程如下：</p>\\n<ol>\\n<li>\\n<p>创建对象：当 Spring 容器创建一个对象时，会将该对象放入一级缓存中。</p>\\n</li>\\n<li>\\n<p>属性注入：当 Spring 容器对该对象进行属性注入时，如果发现该对象依赖于另一个对象，会先创建另一个对象并放入一级缓存中，然后将该对象放入二级缓存中。</p>\\n</li>\\n<li>\\n<p>循环依赖：如果发现另一个对象也依赖于该对象，会从二级缓存中获取该对象并注入到另一个对象中，然后将另一个对象放入二级缓存中。</p>\\n</li>\\n<li>\\n<p>初始化：当所有对象的属性都注入完成后，会按照依赖关系依次初始化对象，并将对象放入三级缓存中。</p>\\n</li>\\n<li>\\n<p>返回对象：当所有对象都初始化完成后，会从三级缓存中获取需要返回的对象，并将三级缓存清空。</p>\\n</li>\\n</ol>","autoDesc":true}`);export{e as data};
